import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios"; 
import { jwtDecode } from "jwt-decode"; 

export default function Login() {
  const navigate = useNavigate();
  const [formValues, setFormValues] = useState({});
  const [formError, setFormError] = useState("");

  const onChangeHandler = (e) => {
    setFormValues({ ...formValues, [e.target.name]: e.target.value });
  };

  const onSubmit = (e) => {
    e.preventDefault();
    axios
      .post(apiUrl + "/api/token/", formValues)
      .then((response) => {
        sessionStorage.setItem("access_token", response.data.access);
        sessionStorage.setItem("refresh_token", response.data.refresh);
        
        const user = jwtDecode(response.data.access); // Decode the token
        const userId = user.user_id; // Get user ID
        const username = user.name; // Get username

        // Store user information in session storage
        sessionStorage.setItem("user_id", userId);
        sessionStorage.setItem("name", username);

        // Navigate to a default page after login
        navigate("/home"); // Adjust this to the default page for all users
      })
      .catch((error) => {
        if (error.response && error.response.status === 401) {
          setFormError(error.response.data.detail);
        }
      });
  };
  return (
    <div className="container" style={{ marginTop: "10em" }}>
      {isLogin ? (
        <h1 className="text-white">Login Page</h1>
      ) : (
        <h1 className="text-white">Registration Page</h1>
      )}

      <hr className="bg-white" />
      <label htmlFor="username" className="form-label text-light">
        Username
      </label>
      <input
        type="text"
        className="form-control"
        id="username"
        placeholder="Enter username..."
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      {Login ? null : (
        <div className="text-white">
          <br />
          <label htmlFor="fname">First Name</label>
          <input
            type="text"
            className="form-control"
            id="fname"
            placeholder="Enter first name..."
            value={fname}
            onChange={(e) => setFname(e.target.value)}
          />
          <br />
          <label htmlFor="lname">Last Name</label>
          <input
            type="text"
            className="form-control"
            id="lname"
            placeholder="Enter last name..."
            value={lname}
            onChange={(e) => setLname(e.target.value)}
          />
          <br />
          <label htmlFor="email">Email</label>
          <input
            type="email"
            className="form-control"
            id="email"
            placeholder="Enter email..."
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </div>
      )}
      <br />
      <label htmlFor="username" className="form-label text-light">
        Password
      </label>
      <input
        type="password"
        className="form-control"
        id="password"
        placeholder="Enter password..."
        value={password}
        onChange={(e) => setPassword(e.target.value)}
      />
      <br />
      {Login ? (
        <button onClick={loginBtn} className="btn btn-primary">
          Login
        </button>
      ) : (
        <button onClick={registerBtn} className="btn btn-primary">
          Register
        </button>
      )}

      <div className="mb-3 text-white">
        <br />
        {Login ? (
          <h5>
            If you don't have an account, please
            <button
              className="btn btn-primary mx-3"
              onClick={() => setLogin(false)}
            >
              Register
            </button>
            here
          </h5>
        ) : (
          <h5>
            If you have an account,
            <button
              className="btn btn-primary mx-3"
              onClick={() => setLogin(true)}
            >
              Login
            </button>
            here
          </h5>
        )}
      </div>
    </div>
  );  
}
